import DMAChannelsResource from './DMAChannels';
import { CPUResources, MemoryResource } from './Resources';
import NetworkBandwithResource  from './Resources';

function App() {
  return (
    <div className="App">
      <CPUResources/>
      <MemoryResource/>
      <NetworkBandwithResource/>
      <DMAChannelsResource/>
    </div>
  );
}

export default App;
